# testing functions
def redefine_input(question_id, data=False):

    class InputMocker:
        def __init__(self):
            pass
        def set_data(self, data):
            self.data = data
            self.index = 0
        def input(self, prompt):
            rv = self.data[self.index]
            self.index+=1
            print(prompt, rv, sep='')
            return str(rv)

    im = InputMocker()

    # set initial data by question_id, if necessary
    if not(data):    
        data = get_data_by_question_id(question_id)
        if data == None:
            # invalid question ID, quit the program
            sys.exit()

    # set up input mocker to work with this data set
    im.set_data(data)

    # redefine global input function to point to the class method 'input'
    return im.input

def get_data_by_question_id(question_id):

    # identify question type and fail out if it's unrecognized
    question_type = question_id[:5]
    if question_type not in ("M0401", "M0402"):
        print("ERROR! Question type is not recognized. Please make sure that you've copied the starter code from Brightspace correctly for this question.")
        return

    # convert question ID to an integer seed
    seed = generate_seed(question_id)

    # construct a new random number generator (not relying on built-in PRNG to get around issues of possible non-universal implementation)
    prng = Generic_PRNG(seed)

    # determine what kind of data needs to be generated
    data = []

    # question type M0401: list of 125 integers
    #                      range of integers -5000 to 5000
    #                      terminating in a string "end"
    if question_type == "M0401":
        num_values = 125
        for i in range(num_values):
            data.append(prng.randint(-5000, 5000))
        data.append("end")

    # question type M0402: list of 1000 integers
    #                      range of integers -5000 to 5000
    if question_type == "M0402":
        num_values = 10000
        for i in range(num_values):
            data.append(prng.randint(-5000, 5000))

    return data

def generate_seed(question_id):
    seed = 0
    for c in question_id:
        seed += ord(c)
    return seed

# Generic PRNG class to generate random values in a predictable manner
# adapted from JavaScript algorithm:  https://gist.github.com/blixt/f17b47c62508be59987b
class Generic_PRNG:

    def __init__(self, seed):
        self.__seed = seed % 2147483647
        if (self.__seed <= 0):
            self.__seed += 2147483646
        self.next()

    # Returns a pseudo-random value between 1 and 2^32 - 2.
    def next(self):
        self.__seed = self.__seed * 16807 % 2147483647
        return self.__seed

    # Returns a pseudo-random floating point number in range [0, 1).
    def next_float(self):
        return (self.next() - 1) / 2147483646

    # Mirror the randint function in Python PRNG
    def randint(self, low, high):
        return int( self.next_float() * (high-low+1) + low )

    # Mirror the uniform function in Python PRNG
    def uniform(self, low, high):
        return self.next_float() * (high-low+1) + low

    # Mirror the choice function on Python PRNG
    def choice(self, seq):
        i = self.randint(0, len(seq)-1)
        return seq[i]


def test_function_question(question_id, function, test_cases):

    def prep_answer(qid, a):
        return qid + a

    view = input(f"We are about to test {len(test_cases)} test cases using your function. Would you like to see the detailed results from each test? (yes/no): ").lower()
    while view not in ['yes', 'no']:
        view = input(f"Plese enter 'yes' or 'no'(no delimiters) ").lower()

    # run test cases against function
    result = ""
    for case_id, case in enumerate(test_cases):
        args = ''
        for i in case:
            if len(args) == 0:
                args += str(i)
            else:
                args += ',' + str(i)
        try:
            if view == "yes":
                print(f"Testing Case #{case_id+1}")
                print(f"- arguments: ({args})")
            rv = eval(f"function({args})")
        except:
            if view == "yes":
                print("- result: runtime error")
            result += "_runtime"
        else:
            if view == "yes":
                print(f"- result: {rv}")
            result += '_'+str(rv)
        if view == "yes":
            print()

    print("Testing complete. To submit your answer please paste the following string into Brightspace as the answer to this question. Ensure that you do not copy any additional spaces as part of your answer:\n")
    print(prep_answer(question_id, result))
    return prep_answer(question_id, result)
